records.addlTxt:
09:31 AM Defendant Curtis L Brown in court with attorney Angela Wang.   District Attorney's Office Law Intern, Jack Rieder, appeared for the State of Wisconsin.
Defense requests this become a plea and sentencing.
State has complied with victim's rights. 
State places offer on the record. 
State has not received a restitution request at this time. 
Court conducts plea colloquy.

Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.
Count 2 is Dismissed and Read in.
State and Defense makes sentencing recommendations.
Defendant makes statement to the court.

Court orders the following:
IMPOSED AND STAYED: 

JAIL:  6 MONTHS in the Waukesha County Jail - Straight-time.
2  Days Credit.

TERM ON PROBATION:  18 MONTHS; Court does not object to transfer to Dane County if accepted; 

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  
*No Use or Possession of alcohol, controlled substances or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed;
*Inform Agent of all prescriptions;
*Obtain or Maintain full-time employment once cleared by your Doctor;
*No contact with:  Co-Defendant or Sew Much More Store; 
*DNA sample to be provided if not yet previously done;

RESTITUTION:  $0 ;
COSTS:  $268
DR GOD SURCHARGE: $10;
**If Defendant completes 25 hours of community service and submits verification prior to 12/31/2022, the Court will consider the Costs and DRGOD Surcharge satisfied. 
DNA SAMPLE AND SURCHARGE:  $250 
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
*To be paid as a Condition of Probation.

Felony warnings, voting rights and firearms warnings given.
